  input: TEXT,F3XA,,"As a result of FEC audit of 97/98 election cycle and amendments
    filed for the entire period, it was discovered that FEC reports have not been
    in balance with 'Cash on Hand' for many years. Specifically, the FEC Report 'Cash
    on Hand' is over DPNM bank balance by $5,133.07. It would be a hopeless enterprise
    to determine even the year in which the discrepancy first occurred. Fec Audit
    Dept. (Mary Moss) and Reports Analysis Dept. (Colleen Manning) provided guidance
    in this matter. It was agreed that DPNM should enter an item to reconcile 'Cash
    on Hand' in the 12/31/2001 FEC Report  supporting line 29 of the detailed summary
    page. Brian Monaghan, for DPNM.         IN RESPONSE TO YOUR LETTER OF  3/19/2003
    REGARDING  YEAR END REPORT (7/10/01-12/31/02), three transfers-in from the DNC
    supporting Line 12 of the Detailed Summary Page totaling $10,605.17 have been
    changed to reflect DNC State Party Victory Fund. These transfers-in from the DNC
    were produced by joint fundraising and should have indicated so. I Appologize.  Schedule
    H2 pertaining to 2001 Legislative  Dinner at LaFonda Hotel has been deleted as
    there were no expenditures for this activity during the reporting period.   REGARDIN
    YOUR LETTER OF 4/10/03, Schedule H2 refering to La Fonda Hotel event has been
    deleted as no corresponding expenditures were  made."
